    "2016-07-27T22:19:47.111523",nt"name": "integrated-pest-management-of-noxious-weeds-on-malheur-national-wildlife-refuge-burns-oreg-b107f",nt"isopen":
    false,nt"url": null,nt"notes": "This is a plan to control noxious weeds
    on Malheur National Wildlife Refuge.  Three alternatives are discussed.  The implementation
    of the preferred alternative will initiate a multi-faceted approach to noxious weed
    management in which refuge management and planning actions are undertaken with adequate
    review, and exploration of all feasible alternatives and a complete understanding
    of how those alternatives or combinations thereof may impact noxious weed distribution
    and abundance.  The following control techniques will be used: irrigation, excavation
    rehabilitation, fire, mowing, farming practices, chemicals, biological controls,
    and monitoring.  The other two alternatives are the no action alternative and the
    maximized spraying alternative.",nt"license_title": "License Not Specified",nt"extras":
